# lightweight multilayer perceptron using tensorflow

import tensorflow as tf, numpy as np, gzip, pickle



with gzip.open('../input/mnist.pkl.gz', 'rb') as f:

    (trainX, trainY), (validX, validY), (testX, testY) = pickle.load(f, encoding='latin1')



def one_hot_encode(x):

    labels = []

    for label in x:

        one_hot = np.array([int(i == label) for i in range(10)])

        labels.append(one_hot)

    return np.array(labels)



mnist_test_images = testX

mnist_test_labels = one_hot_encode(testY)



