def multilayer_perceptron(inputs, weights, biases):

    layer['h1'] = tf.tanh(tf.add(tf.matmul(     inputs, tf.constant(weights['h1'], dtype=tf.float32)), tf.constant(biases['h1'])))

    layer['h2'] = tf.tanh(tf.add(tf.matmul(layer['h1'], tf.constant(weights['h2'], dtype=tf.float32)), tf.constant(biases['h2'])))

    return        tf.tanh(tf.add(tf.matmul(layer['h2'], tf.constant(weights['ot'], dtype=tf.float32)), tf.constant(biases['ot'])))



pred         = multilayer_perceptron(x, weights, biases)

correct_pred = tf.equal(tf.argmax(pred, 1), tf.argmax(y, 1))

accuracy     = tf.reduce_mean(tf.to_float(correct_pred))



with tf.Session() as sess:

    sess.run(tf.global_variables_initializer())

    print('CorrectPredictions/totalTestCases        =', accuracy.eval({x: mnist_test_images, y: mnist_test_labels}))

    

